Friendly reminder: when using {foreach} to #parallel:ize #RStats, your results are in the returned value of foreach()

res &lt;- foreach(x=xs) %dopar% {
  …
}

If you don't use 'res', things won't work as you'd expected because foreach() != for loop (a very common misconception)
